import '../style/Header.css'

const Header = () => {
    return (
        <nav>
            <label>
                    Temelio Fund Manager
            </label>
            <ul>
                <li>
                    <a href="#">Non-Profits</a>
                </li>
                <li>
                    <a href="#">Send Email</a>
                </li>
            </ul>
        </nav>
    );
}

export default Header;
